Verenigde Staten
Komedie / Romantiek
105 minuten

goed

met Amanda Bynes, Channing Tatum en Vinnie Jones

Tiener Viola krijgt te horen dat haar meiden-voetbalteam wordt opgeheven. Zwaar teleurgesteld krijgt ze het plan zich voor te 
doen als haar tweelingbroer, die toch de stad uit is, en ze neemt zijn kamer in op diens high school. Ze wordt echter verliefd op 
kamergenoot Duke en een ander meisje valt weer voor haar, wat allerlei misverstanden oplevert.:
